import React from 'react';
import spinner from './spinner.gif';
import ClipLoader from "react-spinners/ClipLoader";

const Spinner = ({size}) => {
  const override = `
  position: absolute;
  top: 0;
  bottom: 0;
  left:0;
  rigth:0;
  `;
  return(
    <>
      <ClipLoader css={override} size={size}/>
    </>
  )
}

export default Spinner;
